import React from 'react';
import Log from './componentsel/Log';
import Logcr from './componentsel/Logcr';
import { Route } from 'react-router';
import './Login.css';

export default class Login extends React.Component {
  state = {
    login: [],
  };

  Ren = (em, ps) => {
    const newL = {
      email: em,
      password: ps,
      id: this.newId++,
    };
    this.setState(({ login }) => {
      const myLogin = [...login, newL];
      return { login: myLogin };
    });
  };

  render() {
    const { login } = this.state;
    return (
      <div className='login'>
        <Log Ren={this.Ren} />
        <div className='item'>
          {login.map((item) => {
            return <Logcr {...item} />;
          })}
        </div>
      </div>
    );
  }
}
